import React from 'react';
import Fullpage, {
  FullPageSections,
  FullpageSection,
  FullpageNavigation,
} from '@ap.cx/react-fullpage';

const Test = () => {
  const SectionStyle = {
    height: '100vh',
    width: '100%',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };
  return (
    <Fullpage>
      <FullpageNavigation />
      <FullPageSections>
        <FullpageSection style={{ SectionStyle }}>
          <h1>Screnn 1</h1>
        </FullpageSection>
        <FullpageSection style={{ SectionStyle }}>
          <h1>Screnn 2</h1>
        </FullpageSection>
        <FullpageSection style={{ SectionStyle }}>
          <h1>Screnn 3</h1>
        </FullpageSection>
      </FullPageSections>
    </Fullpage>
  );
};

export default Test;
